Model: d_office
Schema: edm_recruiting_rpt
Database: EDW_DEV_SGU
Materialization: incremental
Description: 
Depends On: source.dbt_recruiting.edw_office_rpt.office360_enhanced
SQL: {#
Jira         Date          Who                  Description
===================================================================================================================
GWHD-2094    2024/03/07    Kulvinder Singh     Build materialized views (MV) for Worker 360 and Office 360
GWHD-2100    2024/04/16    Kulvinder Singh     renamed model to D_OFFICE
GWHD-2762    2024/08/23    Kulvinder Singh     updated the 90% logic to include --full-refresh flag logic
#}
{{
  config(
      alias = 'd_office',
      materialized = 'incremental',
      unique_key=['pkhash_office'],
      schema = 'edm_recruiting_rpt',
      tags = ['edm_recruiting_rpt','edw_office_rpt'],
      copy_grants = true
    )
}}

{# a variable used to check if the model already exists if not present it gives 'None' #}
{%- set dest_relation = adapter.get_relation(
      database=this.database,
      schema=this.schema,
      identifier=this.name) -%}
      
{%- set is_inc=is_incremental() -%}

{{- log("is_incremental() : "~ is_inc,info=true) -}}
{{- log("dest_relation: " ~ dest_relation, info=true) -}}
{#-
isInc	Dest table	action
TRUE	exists	    90% check
TRUE	not exists	NA 
FALSE	exists	    full load
FALSE	not exists	full load
-#}
{%- if is_inc -%}
    {# if exists then start the logic of 90%. only load if source columns count is 90% or more than destination #}
    {% if dest_relation != None %}
        {{ log(this ~ " already exists and an incremental refresh is executing. Logic for source 90% check and insert executing", info=true) }}
    {% else %}
        {#- this case can never happen as is_incremental() can't be true is dest_relation does not exists -#}
        {{ log(this ~ " is going to refresh incremetally. Logic for source 90% check and insert executing", info=true) }}
    {% endif %}

    WITH source_table AS (
        SELECT count(*) AS SOURCE_RECORDS_COUNT from {{source('edw_office_rpt','office360_enhanced')}}
        
    ),
    destination_table AS (
        SELECT count(*) AS DESTINATION_RECORDS_COUNT from {{this}}
    )


    select
        {{ dbt_utils.star(from=source('edw_office_rpt','office360_enhanced'), relation_alias='office_view') }},
        dwhash_wid  AS PKHASH_OFFICE
    from {{ source('edw_office_rpt','office360_enhanced') }} office_view 
    WHERE (select SOURCE_RECORDS_COUNT from source_table) >= .9 * (select DESTINATION_RECORDS_COUNT from destination_table)

{% else %}
    {#-                                                                                                  -#}
    {% if dest_relation == None %}
        {{- log(this ~" does not exits. Object creation logic executing " , info=true) -}}
        {#- since object does not exists , so we will directly fetch all that we have in source -#}
    {% else %}
        {{- log(this ~" exists but a full-refresh is passed . Object creation logic executing " , info=true) -}}
        {#- since this is a full refresh we will recreate object from scratch -#}
    {% endif %}
    
    select
        {{ dbt_utils.star(from=source('edw_office_rpt','office360_enhanced'), relation_alias='office_view') }},
        dwhash_wid  AS PKHASH_OFFICE
    from {{ source('edw_office_rpt','office360_enhanced') }} office_view 


{% endif %}

