SQL: {#
Jira         Date          Who                  Description
===================================================================================================================
GWHD-2100    2024/04/05    Kulvinder Singh     Add work table logic to dim_Worker
GWHD-2100    2024/04/16    Kulvinder Singh     updated code so as to incorporate the bug that if dim_finance is not in rpt it will fail
GWHD-2100    2024/04/16    Kulvinder Singh     renamed model to D_WORKER_WORK
GWHD-2156    2024/07/03    Kulvinder Singh     removed worker hist columns
GWHD-2762    2024/08/23    Kulvinder Singh     updated the 90% logic to include --full-refresh flag logic
#}

{{
  config(
      materialized = 'table',
      schema = 'edm_recruiting_etl',
      tags = ['edm_recruiting_rpt','edw_worker_rpt'],
      post_hook = [ '{{ d_worker_swap() }}'],
      copy_grants = true   
    )
}}
-- reapply RAP as post hook when RAP is created in appropriate objects

{# a variable used to check if the model already exists if not present it gives 'None' #}
{%- set dest_relation = adapter.get_relation(
      database=this.database,
      schema='edm_recruiting_rpt',
      identifier='d_worker') -%}

{{ log("dest_relation: " ~ dest_relation, info=true) }}

{# check if the dest_relation edm_recruiting_rpt.dim_finance exists  or not #}
{% if dest_relation != None and flags.FULL_REFRESH == False %}
    {# if exists then start the work table logic. only load to work table if 90% or more is the source columns count#}
    {{ log("edm_recruiting_rpt.d_worker Object Already exists. Logic for source 90% check and insert executing", info=true) }}

     WITH source_table AS (
        SELECT count(*) AS SOURCE_RECORDS_COUNT from {{source('edw_worker_rpt','gw360_enhanced_worker')}}
        
    ),
    destination_table AS (
        SELECT count(*) AS DESTINATION_RECORDS_COUNT from {{ source('edm_recruiting_rpt','d_worker' )}}
    )

    select
    {{ dbt_utils.star(from=source('edw_worker_rpt','gw360_enhanced_worker'), relation_alias='worker_view',except=['HIST_PREFEREDFIRSTNAME','HIST_PREFERREDLASTNAME','HIST_BCG_EMAIL_ADDRESS']) }}
    from {{ source('edw_worker_rpt','gw360_enhanced_worker') }} worker_view
    WHERE (select SOURCE_RECORDS_COUNT from source_table) >= .9 * (select DESTINATION_RECORDS_COUNT from destination_table)
    {#this where condition ensures that only put data if the condition is satisfied#}

{% else %}
    {#if the object edm_Recuriting_rpt.d_finance does not exists, we will create that object so that swap can happen or else it will give error if not present#}
    {% if dest_relation == None %}
        {{ log( "edm_recruiting_rpt.d_finance does not exits. Object creation logic executing ", info=true) }}
        {#- since object does not exists , so we will directly fetch all that we have in source -#}
        {# the query for create a dummy table from dim_finance_v #}
        {% set create_query %}
            CREATE TABLE {{ source('edm_recruiting_rpt','d_worker') }} as (
            SELECT {{dbt_utils.star(from=source('edw_worker_rpt','gw360_enhanced_worker'), relation_alias='worker_view',except=['HIST_PREFEREDFIRSTNAME','HIST_PREFERREDLASTNAME','HIST_BCG_EMAIL_ADDRESS'])}} 
            from {{ source('edw_worker_rpt','gw360_enhanced_worker')}} worker_view WHERE 1=2)
        {% endset %}
        {% do run_query(create_query) %}
        {% if execute %}
            {{ log("create table sucessful",info=true )}}
        {% endif %}
        
    {% else %}
        {{- log("edm_recruiting_rpt.d_finance exists but a full-refresh is passed . Object creation logic executing " , info=true) -}}
        {#- since this is a full refresh we will recreate object from scratch -#}
    {% endif %}

    {# since there is not destination , so we will directly fetch all that we have in source#}
    select
    {{ dbt_utils.star(from=source('edw_worker_rpt','gw360_enhanced_worker'), relation_alias='worker_view',except=['HIST_PREFEREDFIRSTNAME','HIST_PREFERREDLASTNAME','HIST_BCG_EMAIL_ADDRESS']) }}
    from {{ source('edw_worker_rpt','gw360_enhanced_worker') }} worker_view

{% endif %}
